import React, { Component } from 'react'

export default class App extends Component {
    render() {
        return (
            <div>
            <form id='to-do-'>
                <input type='text' placeholder='Enter text'/>
                <button type='submit'>Add</button>
            </form>
                
            </div>
        )
    }
}
